def predict(triples: list[Triple]) -> str:
    if not triples:
        return ""

    sentence = ""
    if not triples:
        return ""

    subject = triples[0].subject
    parts = []

    for triple in triples:
        predicate = triple.predicate
        obj = triple.object

        if predicate == "architecturalStyle":
            parts.append(f"{subject} is built in {obj} style")
        elif predicate == "buildingStartDate":
            parts.append(f"Construction of {subject} started in {obj}")
        elif predicate == "completionDate":
            parts.append(f"{subject} was completed in {obj}")
        elif predicate == "floorCount":
            parts.append(f"{subject} has {obj} floors")
        elif predicate == "location":
            parts.append(f"{subject} is located in {obj}")
        elif predicate == "cost":
            parts.append(f"The cost of {subject} was {obj}")
        elif predicate == "floorArea":
            parts.append(f"{subject} has a floor area of {obj}")
        elif predicate == "owner":
            parts.append(f"{subject} is owned by {obj}")
        elif predicate == "formerName":
            parts.append(f"{subject} was formerly known as {obj}")
        elif predicate == "height":
            parts.append(f"The height of {subject} is {obj} meters")
        elif predicate == "buildingType":
            parts.append(f"{subject} is a {obj}")
        elif predicate == "developer":
            parts.append(f"{subject} was developed by {obj}")
        elif predicate == "tenant":
            parts.append(f"{subject}'s tenant is {obj}")
        elif predicate == "isPartOf":
            parts.append(f"{subject} is part of {obj}")
        elif predicate == "country":
            parts.append(f"{subject} is located in {obj}")
        elif predicate == "currentTenants":
            parts.append(f"Current tenants of {subject} include {obj}")
        elif predicate == "address":
            parts.append(f"The address of {subject} is {obj}")
        elif predicate == "inaugurationDate":
            parts.append(f"{subject} was inaugurated on {obj}")
        else:
            parts.append(f"{subject} {predicate} {obj}")

    sentence = ""
    for i, part in enumerate(parts):
        sentence += part
        if i < len(parts) - 1:
            if part.endswith(".") or part.endswith(","):
                sentence += " "
            else:
                sentence += ", "
    sentence += "."
    return sentence

